{'id': 310206793, 'data_disponibilizacao': '2025-06-30', 'siglaTribunal': 'TJAM', 'tipoComunicacao': 'Intimação', 'nomeOrgao': '10º Juizado Especial Cível da Comarca de Manaus - JE Cível', 'texto': 'Ante o exposto, com fulcro no art. 487, I do Código de Processo Civil, JULGO PARCIALMENTE PROCEDENTES os pedidos formulados na petição inicial,  extinguindo o processo com resolução do mérito, para:

Determinar\xa0a baixa do nome da requerente\xa0da inscrição do\xa0imóvel sob o Código Único de nº 0608801-5;

Julgar improcedente\xa0 o pedido de nulidade dos débitos ante o cancelamento pela requerida;

Julgar improcedente o dano moral.

Sem condenação em custas e honorários de primeiro grau.\xa0

Certificado o trânsito em julgado, arquivem-se os autos com as cautelas de praxe.

P.I.C.

Manaus, data registrada pelo sistema.', 'numero_processo': '00972577320258041000', 'meio': 'D', 'link': None, 'tipoDocumento': 'Sentença', 'nomeClasse': 'PROCEDIMENTO DO JUIZADO ESPECIAL CíVEL', 'codigoClasse': '436', 'numeroComunicacao': 155, 'ativo': True, 'hash': '2nqe4VJbZaQhj5fzTn1XqgZKk7AgOM', 'status': 'P', 'motivo_cancelamento': None, 'data_cancelamento': None, 'datadisponibilizacao': '30/06/2025', 'meiocompleto': 'Diário de Justiça Eletrônico Nacional', 'numeroprocessocommascara': '0097257-73.2025.8.04.1000', 'destinatarios': [{'polo': 'P', 'nome': 'AMAZONAS DISTRIBUIDORA DE ENERGIA S.A', 'comunicacao_id': 310206793}, {'polo': 'A', 'nome': 'JULIANA MENDES DA SILVA', 'comunicacao_id': 310206793}], 'destinatarioadvogados': [{'id': 530964264, 'comunicacao_id': 310206793, 'advogado_id': 587767, 'created_at': '2025-06-27T01:03:46', 'updated_at': '2025-06-27T01:03:46', 'advogado': {'id': 587767, 'nome': 'WANDERLEY SAN DA CRUZ BARBOSA', 'numero_oab': '15335N', 'uf_oab': 'AM'}}, {'id': 530964265, 'comunicacao_id': 310206793, 'advogado_id': 3076591, 'created_at': '2025-06-27T01:03:46', 'updated_at': '2025-06-27T01:03:46', 'advogado': {'id': 3076591, 'nome': 'MARCELA INARA LOPES DE ALMEIDA', 'numero_oab': '20139N', 'uf_oab': 'AM'}}, {'id': 530964266, 'comunicacao_id': 310206793, 'advogado_id': 496607, 'created_at': '2025-06-27T01:03:46', 'updated_at': '2025-06-27T01:03:46', 'advogado': {'id': 496607, 'nome': 'PAULA REGINA DA SILVA MELO', 'numero_oab': '7490N', 'uf_oab': 'AM'}}]}

{'id': 310207103, 'data_disponibilizacao': '2025-06-30', 'siglaTribunal': 'TJAM', 'tipoComunicacao': 'Intimação', 'nomeOrgao': '10ª Vara Cível e de Acidentes de Trabalho da Comarca de Manaus - Cível', 'texto': 'Vistos.

Trata-se de ação na qual a parte autora contesta os valores cobrados pela concessionária por consumo de energia elétrica.

De plano, verifico que a petição inicial não encontra-se instruída com documentos suficientes a possibilitar a análise da medida liminar, bem como possui defeito capaz de dificultar o julgamento de mérito.

Assim, deve a autora:

\x96 juntar faturas dos últimos 12 meses;

\x96 juntar o termo de inspeção (TOI), se possuir cópia;

\x96 informar se a concessionária realizou alguma inspeção/vistoria na unidade consumidora e, em caso positivo, juntar o termo de inspeção (TOI), se possuir cópia;

\x96 informar se a concessionária realizou notificação de procedimento para apurar recuperação de consumo e/ou notificação de corte de fornecimento de energia e, em caso positivo, juntar aos autos, se possuir cópia;

Com efeito, intime-se a parte autora, por seu advogado, para emendar a petição inicial, no prazo de 15 dias, conforme acima indicado, sob pena de indeferimento liminar, com fulcro no art. 321, parágrafo único, 330,I e 485, I do CPC.

Decorrido o prazo legal, com ou sem resposta do requerente, voltem-me, imediatamente, os autos conclusos.

Intime-se.', 'numero_processo': '01736348520258041000', 'meio': 'D', 'link': None, 'tipoDocumento': 'DECISÃO INICIAL', 'nomeClasse': 'PROCEDIMENTO COMUM CíVEL', 'codigoClasse': '7', 'numeroComunicacao': 323, 'ativo': True, 'hash': 'mMg9oWrBR9Lh2NTjTpDBMLYzwDv82Q', 'status': 'P', 'motivo_cancelamento': None, 'data_cancelamento': None, 'datadisponibilizacao': '30/06/2025', 'meiocompleto': 'Diário de Justiça Eletrônico Nacional', 'numeroprocessocommascara': '0173634-85.2025.8.04.1000', 'destinatarios': [{'polo': 'P', 'nome': 'AMAZONAS DISTRIBUIDORA DE ENERGIA S.A', 'comunicacao_id': 310207103}, {'polo': 'A', 'nome': 'JAISE SILVA DE OLIVEIRA ALCANTARA', 'comunicacao_id': 310207103}], 'destinatarioadvogados': [{'id': 530964867, 'comunicacao_id': 310207103, 'advogado_id': 496498, 'created_at': '2025-06-27T01:07:24', 'updated_at': '2025-06-27T01:07:24', 'advogado': {'id': 496498, 'nome': 'SISTEMA DE CITAÇÃO E INTIMAÇÃO ELETRÔNICA', 'numero_oab': '99999999N', 'uf_oab': 'AM'}}, {'id': 530964866, 'comunicacao_id': 310207103, 'advogado_id': 525219, 'created_at': '2025-06-27T01:07:24', 'updated_at': '2025-06-27T01:07:24', 'advogado': {'id': 525219, 'nome': 'MARCIA BRAGA DA SILVA', 'numero_oab': '13508N', 'uf_oab': 'AM'}}]}

{'id': 310389709, 'data_disponibilizacao': '2025-06-30', 'siglaTribunal': 'TJAM', 'tipoComunicacao': 'Intimação', 'nomeOrgao': '18º Juizado Especial Cível da Comarca de Manaus - JE Cível', 'texto': 'Ante o exposto, CONCEDO a TUTELA DE URGÊNCIA, para o fim de determinar que a parte requerida\xa0abstenha-se de suspender o fornecimento de energia no imóvel da parte autora, em relação aos débitos discutidos na inicial, a contar da intimação, nos termos do art. 300, caput, do CPC, fixando multa de R$ 10.000,00 (dez mil reais), em caso de descumprimento, devendo a parte requerida comprovar nos autos o cumprimento dessa obrigação.

Aguarde-se o decurso do prazo para contestação.\xa0

Após, retornem os autos conclusos à sentença.', 'numero_processo': '01657422820258041000', 'meio': 'D', 'link': None, 'tipoDocumento': 'Decisão', 'nomeClasse': 'PROCEDIMENTO DO JUIZADO ESPECIAL CíVEL', 'codigoClasse': '436', 'numeroComunicacao': 1442, 'ativo': True, 'hash': 'AOMEBVQ8YpJhQvfmTWGPwo6d9l2zaP', 'status': 'P', 'motivo_cancelamento': None, 'data_cancelamento': None, 'datadisponibilizacao': '30/06/2025', 'meiocompleto': 'Diário de Justiça Eletrônico Nacional', 'numeroprocessocommascara': '0165742-28.2025.8.04.1000', 'destinatarios': [{'polo': 'P', 'nome': 'AMAZONAS DISTRIBUIDORA DE ENERGIA S.A', 'comunicacao_id': 310389709}, {'polo': 'A', 'nome': 'VITORIA NUBIA FERNANDES', 'comunicacao_id': 310389709}], 'destinatarioadvogados': [{'id': 531349657, 'comunicacao_id': 310389709, 'advogado_id': 496498, 'created_at': '2025-06-27T10:13:21', 'updated_at': '2025-06-27T10:13:21', 'advogado': {'id': 496498, 'nome': 'SISTEMA DE CITAÇÃO E INTIMAÇÃO ELETRÔNICA', 'numero_oab': '99999999N', 'uf_oab': 'AM'}}, {'id': 531349656, 'comunicacao_id': 310389709, 'advogado_id': 1354378, 'created_at': '2025-06-27T10:13:21', 'updated_at': '2025-06-27T10:13:21', 'advogado': {'id': 1354378, 'nome': 'DANIEL DA COSTA CUNHA', 'numero_oab': '18423N', 'uf_oab': 'AM'}}]}

